// src/pages/UserHistory.jsx
import React, { useEffect, useState, useCallback } from "react";
import axios from "axios";
import TopBar from "../components/TopBar";
import { useAuth } from "../context/AuthContext";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

function UserHistory() {
  const { user } = useAuth();
  const [logs, setLogs] = useState([]);
  const [search, setSearch] = useState("");
  const [actionFilter, setActionFilter] = useState("all");
  const [dateFilter, setDateFilter] = useState(null);

  const fetchLogs = useCallback(async () => {
    try {
      const res = await axios.get(`/api/user/${user.username}/logs`);
      setLogs(res.data);
    } catch (err) {
      console.error("Failed to fetch user logs:", err);
    }
  }, [user.username]);

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const res = await axios.get("/api/items/my-logs");
        setLogs(res.data);
      } catch (err) {
        console.error("Failed to load logs", err);
      }
    };
    fetchLogs();
  }, []);

  const filtered = logs.filter((log) => {
    const matchesSearch =
      log.barcode?.toLowerCase().includes(search.toLowerCase()) ||
      log.clientName?.toLowerCase().includes(search.toLowerCase()) ||
      log.room?.toLowerCase().includes(search.toLowerCase()) ||
      log.eventNumber?.toLowerCase().includes(search.toLowerCase());

    const matchesAction =
      actionFilter === "all" || log.action === actionFilter;

    const matchesDate =
      !dateFilter ||
      new Date(log.timestamp).toDateString() === dateFilter.toDateString();

    return matchesSearch && matchesAction && matchesDate;
  });

  return (
    <>
      <TopBar />
      <div className="p-6 bg-gray-900 text-white min-h-screen">
        <h2 className="text-3xl font-bold text-center text-asuGold mb-6">
          My Item Log History
        </h2>

        <div className="flex flex-col md:flex-row gap-3 mb-4">
          <input
            type="text"
            placeholder="Search barcode, client, room..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="bg-gray-800 border border-gray-600 px-3 py-2 rounded text-white w-full md:w-1/3"
          />
          <select
            value={actionFilter}
            onChange={(e) => setActionFilter(e.target.value)}
            className="bg-gray-800 border border-gray-600 px-3 py-2 rounded text-white w-full md:w-1/4"
          >
            <option value="all">All</option>
            <option value="check_in">Checked In</option>
            <option value="check_out">Checked Out</option>
          </select>
          <DatePicker
            selected={dateFilter}
            onChange={(date) => setDateFilter(date)}
            placeholderText="Filter by date"
            className="bg-gray-800 border border-gray-600 px-3 py-2 rounded text-white w-full md:w-1/3"
            maxDate={new Date()}
            isClearable
          />
        </div>

        <div className="overflow-x-auto">
          <table className="w-full table-auto text-left text-sm">
            <thead className="bg-gray-700 text-gray-200">
              <tr>
                <th className="px-4 py-2">Date</th>
                <th className="px-4 py-2">Time</th>
                <th className="px-4 py-2">Action</th>
                <th className="px-4 py-2">Barcode</th>
                <th className="px-4 py-2">Room</th>
                <th className="px-4 py-2">Client</th>
                <th className="px-4 py-2">Event #</th>
              </tr>
            </thead>
            <tbody className="bg-gray-800">
              {filtered.map((log, i) => {
                const d = new Date(log.timestamp);
                return (
                  <tr key={i} className="border-t border-gray-700">
                    <td className="px-4 py-2">{d.toLocaleDateString()}</td>
                    <td className="px-4 py-2">{d.toLocaleTimeString()}</td>
                    <td
                      className={`px-4 py-2 font-semibold text-$
                        {log.action === "check_in" ? "green-400" : "red-400"}`}
                    >
                      {log.action === "check_in" ? "Checked In" : "Checked Out"}
                    </td>
                    <td className="px-4 py-2">{log.barcode}</td>
                    <td className="px-4 py-2">{log.room || "—"}</td>
                    <td className="px-4 py-2">{log.clientName || "—"}</td>
                    <td className="px-4 py-2">{log.eventNumber || "—"}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
}

export default UserHistory;
